pragma solidity  >=0.4.22 <0.6.0;

contract Owned {
    address owner;
    constructor() public {
        owner = msg.sender;
    }
    
   modifier onlyOwner {
       require(msg.sender == owner);
       _;
   }
}


contract StudentDetails is Owned {
  string public title;

  constructor() public{
    title = "ACADEMIC CREDENTIAL VERIFICATION TECHNIQUE USING BLOCKCHAIN";
  }

    struct Student{
        string regNo;
        string firstName;
        string lastName;
        uint dateDOB;
        uint monthDOB;
        uint yearDOB;
        uint yearOfGraduation;
        uint wholeCGPA;
        uint decimalCGPA;
        uint wholePercentage;
        uint decimalPercentage;
        //uint noOfSubjects;
        //string[] subjectName;
        //uint[] subjectMarks;
    }
    
    mapping (uint => Student) studentList;
    uint[] public studIdList;

    event studentCreationEvent(
       string regNo,
       string firstName,
       string lastName,
       uint dateDOB,
       uint monthDOB,
       uint yearDOB,
       uint yearOfGraduation,
       uint wholeCGPA,
       uint decimalCGPA,
       uint wholePercentage,
       uint decimalPercentage
       //uint noOfSubjects,
       //string[] subjectName,
       //uint[] subjectMarks
    );
    
    function createStudent(uint _studId, string memory _regNo, string memory _firstName, string memory _lastName, uint _dateDOB, uint _monthDOB, uint _yearDOB, uint _yearOfGraduation, uint _wholeCGPA, uint _decimalCGPA, uint _wholePercentage, uint _decimalPercentage) onlyOwner public {
        Student memory student = studentList[_studId];
        //struct StudentDetails.Student
        //var student = studentList[_studId];
        student.regNo = _regNo;
        student.firstName = _firstName;
        student.lastName = _lastName;
        student.dateDOB = _dateDOB;
        student.monthDOB = _monthDOB;
        student.yearDOB = _yearDOB;
        student.yearOfGraduation = _yearOfGraduation;
        student.wholeCGPA = _wholeCGPA;
        student.decimalCGPA = _decimalCGPA;
        student.wholePercentage = _wholePercentage;
        student.decimalPercentage = _decimalPercentage;
        
        studIdList.push(_studId) -1;
        emit studentCreationEvent(_regNo, _firstName, _lastName, _dateDOB, _monthDOB, _yearDOB, _yearOfGraduation, _wholeCGPA, _decimalCGPA, _wholePercentage, _decimalPercentage);
    }
    
    /*
    event gradesEntered(
        uint noOfSubjects,
        unit subject[]
    );
    */

    
    function getStudents() view public returns(uint[] memory) {
        return studIdList;
    }
    
    function getParticularStudent(uint _studId) public view returns (string memory, string memory, string memory, uint, uint, uint, uint, uint, uint, uint, uint) {
        Student memory u = studentList[_studId];
        return (u.regNo, u.firstName, u.lastName, u.dateDOB, u.monthDOB, u.yearDOB, u.yearOfGraduation, u.wholeCGPA, u.decimalCGPA, u.wholePercentage, u.wholePercentage);
    }

    function countStudents() view public returns (uint) {
        return studIdList.length;
    }
}
